import React from "react";
import Carousel from "react-hook-carousel";
function MyCarousel() {
  const slider = [
    {
      image: "http://movie0706.cybersoft.edu.vn/hinhanh/kieu_gp09.jpeg",
      alt: "alt image1",
    },
    {
      image:
        "http://movie0706.cybersoft.edu.vn/hinhanh/the-secret-garde_gp09.jpg",
      alt: "alt image2",
    },
    {
      image: "http://movie0706.cybersoft.edu.vn/hinhanh/radioactive-2_gp09.jpg",
      alt: "alt image3",
    },
    {
      image: "http://movie0706.cybersoft.edu.vn/hinhanh/da-5-bloods_gp09.jpg",
      alt: "alt image4",
    },
  ];
  return 123;
}

export default MyCarousel;
